INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8034066307447', 'kefir cremoso pesca e albicocca', 'ed e noto per essere considerato la bevanda dei centenari. ll termine kefir, un particolare latte fermentato consumato da secoli nella tradizione ,deriva da una parola armena, keif, il cui significato è proprio benessere. Kefir CON CREMA DI LATTE CON PESCHE E ALBICOCCHE SENZA LIEVITI DI FERMENTAZIONE DEL LATTOSIO Ingredienti: latte intero 70%, preparazione di frutta 20% (zucchero, albicocche 20% pesche 17, 5%,succo di albicocca da concentrato 7,5%, amido, aroma naturale), crema di latte 7,8% zucchero, fermenti lattici vivi (Lactococcus lactis, Lactobacillus acidophilus, Lactobacillus helveticus, Lactobacillus lactis, Lactococcus cremoris, Streptococcus thermophilus Bifidobacterium lactis), Senza glutine. Senza coloranti e conservanti aggiunti. Da consumare entro: vedi sopra. Conservare in frigo tra +1°C e +6°C  Prodotto in Austria per L.N.Srl, Via Borgogna 2, 20122 Milano', 'https://static.openfoodfacts.org/images/products/803/406/630/7447/front_it.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

